(function($){$.one=function(selector){return $(selector).onlyOne()};$.fn.findOne=function(selector){return this.find(selector).onlyOne()};$.fn.onlyOne=function(message){if(this.length!=1){throw message||"Expected one element"}return this};$.many=function(selector){return $(selector).atLeastOne()};$.fn.findMany=function(selector){return this.find(selector).atLeastOne()};$.fn.atLeastOne=function(message){if(this.length==0){throw message||"No elements found"}return this}})(jQuery);